/*
 * Reset the line numbers if this code block starts part-way through the source
 */

Prism.hooks.add('after-highlight', function (env) {
  var pre = env.element.parentNode;

  if (!pre || !/pre/i.test(pre.nodeName) || pre.className.indexOf('line-numbers') === -1) {
    return;
  }

  var linesNum = (env.code.split('\n').length);
  var lineNumbersWrapper;

  lines = new Array(linesNum);
  lines = lines.join('<span></span>');

  lineNumbersWrapper = document.createElement('span');
  lineNumbersWrapper.className = 'line-numbers-rows';
  lineNumbersWrapper.innerHTML = lines;

  if (pre.hasAttribute('data-start')) {
    pre.style.counterReset = 'linenumber ' + (parseInt(pre.getAttribute('data-start'), 10) - 1);
  }

  env.element.appendChild(lineNumbersWrapper);
});

// Note: the actions taken by the overlay must be idempotent, they're used in an
// after-highlight hook which is run multiple times.
function SourceOverlay(pre) {
  this.$pre = $(pre);

  this.leftPadding = this.$pre.css("paddingLeft");
  this.width = parseFloat(this.$pre.innerWidth()) - parseFloat(this.leftPadding) + "px"
  this.lineHeight = this.$pre.find("code").css("lineHeight");
  this.brickWidth = 7; // pixels

  this.annotationClasses = "";
  this.lineClasses = "";

  this.coverage = this.$pre.data("coverage");
  this.annotation = this.$pre.data("annotation");

  if (this.annotation) {
    this.annotationClasses = this.annotation.
      categories.map(function(category) {
        return "js-filter-" + category;
      }).join(" ");

    this.lineClasses = this.annotation.
      body_categories.map(function(category) {
        return "js-filter-line-" + category;
      }).join(" ");
  }
}

SourceOverlay.prototype.addAnnotation = function() {
  if (!this.annotation) {
    return;
  }

  this.$pre.prev(".annotation").remove();
  this.$pre.addClass(this.lineClasses);

  if (this.annotation.name != "continuation") {
    var margin = parseFloat(this.leftPadding);

    if (this.coverage) {
      margin += this.brickWidth;
    }

    // Handle legacy descriptions. Post-engines, all descriptions will be arrays
    if (typeof(this.annotation.description) == "string") {
      var annotation_desc = $("<span>").
        addClass("annotation__desc").
        html(this.annotation.description);
    } else {
      var annotation_desc = $("<span>").
        addClass("annotation__desc");

      $.each(this.annotation.description, function(_, part) {
        var span = $("<span>").
              addClass("annotation__desc_part").
              html(part);

        annotation_desc.append(span);
      });
    }

    var annotation_headline = $("<div>").
      addClass("annotation").
      addClass(this.annotationClasses).
      html(annotation_desc);

    annotation_headline.insertBefore(this.$pre)
  }
};

SourceOverlay.prototype.overlayLine = function(lineNo, relativeLineNo) {
  this.$pre.find("span.coverage-brick.line-" + lineNo).remove();
  this.$pre.find("span.smell-brick.line-" + lineNo).remove();
  this.$pre.find("span.line.line-" + lineNo).remove();

  var line = $("<span>").addClass("line line-" + lineNo)
    , currentGutter = this.brickWidth;

  if (this.coverage) {
    var cBrick = $("<span>").addClass("coverage-brick line-" + lineNo)
      , lineCoverage = this.coverage[lineNo - 1];

    cBrick.css({
      display:  "block",
      width:    this.brickWidth + "px",
      height:   this.lineHeight,
      top:      (relativeLineNo * parseFloat(this.lineHeight)),
      left:     this.leftPadding,
      position: "absolute"
    })

    if (lineCoverage > 0) {
      cBrick.addClass("covered")
      line.addClass("covered");
    } else if (lineCoverage == 0) {
      cBrick.addClass("missed")
      line.addClass("missed");
    }

    this.$pre.append(cBrick);
    currentGutter = 2 * this.brickWidth;
  }

  if (this.annotation) {
    line.addClass(this.lineClasses);

    var sBrick = $("<span>").addClass("smell-brick line-" + lineNo);

    sBrick.css({
      display:  "block",
      width:    this.brickWidth,
      height:   this.lineHeight,
      top:      (relativeLineNo * parseFloat(this.lineHeight)),
      left:     this.leftPadding,
      position: "absolute"
    })

    this.$pre.append(sBrick);
  }

  line.css({
    display:  "block",
    width:    this.width,
    height:   this.lineHeight,
    top:      (relativeLineNo * parseFloat(this.lineHeight)),
    left:     this.leftPadding,
    position: "absolute"
  });

  this.$pre.append(line);
  this.$pre.find("code").css({ paddingLeft: currentGutter + "px" });
};

/*
 * Overlay the coverage and smell annotations for this source block
 */
Prism.hooks.add('after-highlight', function (env) {
  var pre = env.element.parentNode;

  if (!pre || !/pre/i.test(pre.nodeName) || pre.className.indexOf('line-numbers') === -1) {
    return;
  }

  var endLine = env.code.split('\n').length - 1
    , startLine = $(pre).data("start");

  overlay = new SourceOverlay(pre);
  overlay.addAnnotation();

  for (var i = 0; i < endLine; i++) {
    overlay.overlayLine(i + startLine, i);
  }
});
